using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct AttackComponentResolver : IResolver<AttackComponent>, IResolver<AttackComponentResolver,AttackComponent>, IData	{		public AttackComponentResolver In(ref AttackComponent attackcomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<AttackComponent>();			Out(ref local);		}		public void Out(ref AttackComponent attackcomponent)		{		}	}}